// App.js

import './App.css';
import React, { useState, useEffect } from 'react';
import axios from 'axios';
import Container from 'react-bootstrap/Container';
import Navbar from 'react-bootstrap/Navbar';
import Button from 'react-bootstrap/Button';
import Form from 'react-bootstrap/Form';
import { BrowserRouter as Router, Route, Switch, Link } from 'react-router-dom'; // Import Link from react-router-dom
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faSearch } from '@fortawesome/free-solid-svg-icons';
import Features from './Features'; // Import the Features component

axios.defaults.xsrfCookieName = 'csrftoken';
axios.defaults.xsrfHeaderName = 'X-CSRFToken';
axios.defaults.withCredentials = true;

const client = axios.create({
  baseURL: "http://127.0.0.1:8000"
});

function App() {
  const [currentUser, setCurrentUser] = useState();
  const [registrationToggle, setRegistrationToggle] = useState(false);
  const [email, setEmail] = useState('');
  const [username, setUsername] = useState('');
  const [password, setPassword] = useState('');

  useEffect(() => {
    client.get("/api/user")
      .then(function(res) {
        setCurrentUser(true);
      })
      .catch(function(error) {
        setCurrentUser(false);
      });
  }, []);

  function update_form_btn() {
    if (registrationToggle) {
      document.getElementById("form_btn").innerHTML = "Register";
      setRegistrationToggle(false);
    } else {
      document.getElementById("form_btn").innerHTML = "Log in";
      setRegistrationToggle(true);
    }
  }

  function submitRegistration(e) {
    e.preventDefault();
    client.post(
      "/api/register",
      {
        email: email,
        username: username,
        password: password
      }
    ).then(function(res) {
      client.post(
        "/api/login",
        {
          email: email,
          password: password
        }
      ).then(function(res) {
        setCurrentUser(true);
      });
    });
  }

  function submitLogin(e) {
    e.preventDefault();
    client.post(
      "/api/login",
      {
        email: email,
        password: password
      }
    ).then(function(res) {
      setCurrentUser(true);
    });
  }

  function submitLogout(e) {
    e.preventDefault();
    client.post(
      "/api/logout",
      { withCredentials: true }
    ).then(function(res) {
      setCurrentUser(false);
    });
  }

  return (
    <Router>
      <div>
        <Navbar bg="dark" variant="dark">
          <Container>
            <Navbar.Brand>Authentication App</Navbar.Brand>
            <Navbar.Toggle />
            <Navbar.Collapse className="justify-content-end">
              {currentUser ? (
                <Navbar.Text>
                  <form onSubmit={e => submitLogout(e)}>
                    <Button type="submit" variant="light">Log out</Button>
                  </form>
                </Navbar.Text>
              ) : (
                <Navbar.Text>
                  <Button id="form_btn" onClick={update_form_btn} variant="light">
                    {registrationToggle ? "Register" : "Log in"}
                  </Button>
                </Navbar.Text>
              )}
            </Navbar.Collapse>
          </Container>
        </Navbar>
        <div className="button-container">
          <button className="button support">Support</button>
          <button className="button community">Community</button>
          <Link to="/features" className="button features">Features</Link> {/* Link to Features page */}
          <a href="/login" className="button login">Login</a>
          <button className="button contact-us">Contact Us</button>
          <button className="button language">English</button>
          <button className="button search-button">
            <FontAwesomeIcon icon={faSearch} />
          </button>
        </div>

        <Switch>
          <Route path="/features">
            <Features />
          </Route>
        </Switch>
      </div>
    </Router>
  );
}

export default App;
